import React, { Component } from "react";

class Preview extends Component {
  constructor(props) {
    super(props);

    this.previewEducations = this.previewEducations.bind(this);
  }

  previewEducations() {
    let jsxArray = [];
    this.props.cvData.education.forEach((educationObj) => {
      console.log("education");
      jsxArray = [
        ...jsxArray,
        <div>this is education obj data:{educationObj.firstName}</div>,
      ];
    });
    return jsxArray;
  }

  render() {
    const { cvData } = this.props;
    return (
      <div className="previewContainer">
        <div>the first name is: {cvData.firstName}</div>
        <div>the last name is: {cvData.lastName}</div>
        <div>the email is: {cvData.email}</div>
        <div>the number is: {cvData.phone}</div>
        {this.previewEducations()}
      </div>
    );
  }
}

export default Preview;
